INSERT INTO ${tablename_tr:prepend('core_db.')}
SELECT ${columns}
FROM ${tablename_tr:prepend('raw_db.')}
where ${first_c} is not null
on conflict do nothing;

SELECT string_agg(column_name ||'::'||data_type,', ') as column_and_type
FROM information_schema.columns
WHERE table_schema = 'core_db' AND table_name = '${tablename_tr}';

ALTER TABLE ${tablename_tr:prepend('core_db.')} 
ADD CONSTRAINT ${fkname}
FOREIGN KEY (${propertyname}) REFERENCES ${associationname:prepend('core_db.')} (ref_key);
